css:
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #1e1e1e;
}
.timecop .panels {
  display: flex;
  flex-direction: row;
}
.timecop .package-panel {
  display: flex;
  flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .text-info {
  margin-bottom: 14px;
}
.timecop .timing,
.timecop .list-item {
  display: flex;
  justify-content: space-between;
}
.timecop .timing .inline-block:last-child,
.timecop .list-item .inline-block:last-child {
  margin-right: 0;
}
.timecop .timing {
  margin-bottom: 14px;
}
.timecop .list-item {
  margin-top: 7px;
  margin-bottom: 7px;
}
.timecop .package {
  color: #d6d6d6;
}
.timecop .package:hover {
  text-decoration: none;
  color: #FFFFFF;
}
.timecop .timecop-line {
  flex: 1 1 0;
  margin-right: 14px;
  margin-top: .80em;
  border-top: 1px dashed rgba(214, 214, 214, 0.2);
}
.timecop .package:hover + .timecop-line {
  border-color: rgba(214, 214, 214, 0.6);
}
